import React from 'react';
import LoadingOverlay from 'react-loading-overlay';
import './App.css';
import logo from './logo_kinea.png'

var Loader = require('react-loader');

class EditExtracted extends React.Component {
constructor(props) {
    super(props);
    this.state = {
        'data': props.data, //passed prop as initial value
    }
    // this.handleInputChange = this.handleInputChange.bind(this);
    this.onSubmit = this.onSubmit.bind(this);
    }

    onSubmit(e) {
        e.preventDefault();
        console.log(this.tipico_check.checked)
        if (this.tipico_check.checked) { console.log(this.tipico.value)}
        else{ console.log(this.tipico.defaultValue)}
    }

    // handleInputChange(event) {
    //     const target = event.target;
    //     // const value = target.type === 'checkbox' ? target.checked : target.value;
    //     const value = target.value;
    //     const name = target.name;

    //     // this.setState({
    //     //   [name]: value
    //     // });
    //     this.setState(final => ({
    //         ...final,
    //         [name]: value}))
    //     // console.log(this.state)
    //   }

   to_list() {
    let lista = [];
    for (var key in this.props.data.pdfContent.raw) {
        lista.push([key,this.props.data.pdfContent.raw[key],this.props.data.pdfContent.tratado[key]])
    }
    return lista
    }

  render() {
    //   console.log(this.props.data.pdfContent.raw)
    // let items = this.to_list()
    // let itemList=items.map((item)=>{
    //     return(
    //         <div className='card_data'>
    //              <h4 className='title'>{item[0]}</h4>
    //              <p className='subtitle'>{item[1]}</p>
    //              <input type='text' className='data_edit' defaultValue={item[2]}></input>
    //          </div>
    //     ) 
    //   })

        let itemList=this.props.data.pdfContent.raw.descontos.map((item)=>{
            //console.log(item)
        return(
            <div className='card_data'>
                 <h4 className='title'>Desconto</h4>
                 <p className='subtitle'>Prazo</p>
                 <input type='text' className='data_edit' defaultValue={item.periodo[0]}></input>
                 <input style={{marginLeft: 6 + 'px'}} type='text' className='data_edit' defaultValue={item.periodo[1]}></input>
                 <p className='subtitle'>Valor</p>
                 <input type='text' className='data_edit' defaultValue={item.desconto}></input>
             </div>
        ) 
      })
    return (
      <div className='total_grid'>
        <h1 className='title2' >Confira o Conteúdo Extraído</h1>
        <form>
        <div className='data_grid'>
            <div className='card_data'>
                <h4 className='title'>Contrato Típico</h4>
                <p className='subtitle'>{this.props.data.pdfContent.raw.tipico}</p>
                {/* onChange={this.handleInputChange}  */}
                <input name='tipico' type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.tipico} ref={(c) => this.tipico = c}></input>
                <label className='alterado_check'><input className='alterado_check' type='checkbox' ref={(c) => this.tipico_check = c} />Alterado</label>       

            </div>
            <div className='card_data'>
                <h4 className='title'>Locatária</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.locataria}</p>
                <input type='text' className='data_edit_big' defaultValue={this.state.data.pdfContent.tratado.locataria} ref={(c) => this.locataria = c}></input>
                {/* <div className='checker'> */}
                <label className='alterado_check'><input className='alterado_check' type='checkbox'  />Alterado</label>
                {/* </div> */}
            </div>
            <div className='card_data'>
                <h4 className='title'>Tipo do imóvel</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.tipo_imovel}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.tipo_imovel} ref={(c) => this.tipo_imovel = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Nome do Imóvel</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.nome }</p>
                <input type='text' className='data_edit_big' defaultValue={this.state.data.pdfContent.tratado.nome } ref={(c) => this.nome = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Área do Imóvel</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.area}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.area} ref={(c) => this.area = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Andar ou Galpão</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.andar || this.state.data.pdfContent.raw.galpao }</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.andar ||this.state.data.pdfContent.tratado.galpao} ref={(c) => this.andar_galpao = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Pavimento/Torre ou Docas</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.torre || this.state.data.pdfContent.raw.docas }</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.torre || this.state.data.pdfContent.tratado.docas} ref={(c) => this.torre_docas = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Vagas</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.vagas }</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.vagas } ref={(c) => this.vagas = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Início Vigência</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.inicio_vigencia }</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.inicio_vigencia } ref={(c) => this.inicio_vigencia = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Fim Vigência</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.fim_vigencia }</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.fim_vigencia } ref={(c) => this.fim_vigencia = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Valor Aluguel</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.valor_aluguel }</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.valor_aluguel } ref={(c) => this.valor_aluguel = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Data de Reajuste</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.data_reajuste }</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.data_reajuste } ref={(c) => this.data_reajuste= c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Data Início da Carência</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.data_inicio_carencia}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.data_inicio_carencia } ref={(c) => this.data_inicio_carencia = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Período da Carência</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.periodo_carencia}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.periodo_carencia } ref={(c) => this.periodo_carencia = c}></input>
            </div>
            {itemList}
            <div className='card_data'>
                <h4 className='title'>Reajuste Positivo</h4>
                {/* <p className='subtitle'>{this.props.data.pdfContent.raw.reajuste_positivo}</p> */}
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.reajuste_positivo } ref={(c) => this.reajuste_positivo = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Índice do Reajuste</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.indice}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.indice } ref={(c) => this.indice = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Forma de Pagamento</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.pagamento_aluguel}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.pagamento_aluguel } ref={(c) => this.pagamento_aluguel = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Data de Pagamento do Aluguel</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.data_pagamento_encargos}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.data_pagamento_encargos } ref={(c) => this.data_pagamento_encargos = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Garantia</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.garantia}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.garantia} ref={(c) => this.garantia = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Valor da Garantia</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.valor_garantia}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.valor_garantia} ref={(c) => this.valor_garantia = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Aviso Prévio</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.aviso_previo}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.aviso_previo} ref={(c) => this.aviso_previo = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Multa por Rescisão Antecipada</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.multa_rescisao_antecipado}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.multa_rescisao_antecipado} ref={(c) => this.multa_rescisao_antecipado = c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Multa Proporcional</h4>
                {/* <p className='subtitle'>{this.props.data.pdfContent.raw.proporcional}</p> */}
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.proporcional} ref={(c) => this.proporcional= c}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Multa por Inadimplência</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.multa_inadimplencia}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.multa_inadimplencia}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Prazos para Multas</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.prazos_multas}</p>
                <input type='text' className='data_edit_mid' defaultValue={this.state.data.pdfContent.tratado.prazos_multas}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Juros ao mês</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.juros_ao_mes}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.juros_ao_mes}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Data de Assinatura do Contrato</h4>
                <p className='subtitle'>{this.state.data.pdfContent.raw.data_assinatura}</p>
                <input type='text' className='data_edit' defaultValue={this.state.data.pdfContent.tratado.data_assinatura}></input>
            </div>
        </div>
        </form>
        <div>
            <button className='b_extrair' onClick={this.onSubmit}>Teste</button>     
          </div>
      </div>
    );
  }
}

export default EditExtracted;
